import React, { useState } from "react";

const Signup = () => {
  const [formData, setFormData] = useState({
    fullName: "",
    email: "",
    role: "",
    password: "",
    confirmPassword: "",
  });

  const roles = ["Student", "Professor", "Admin"];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      alert("Passwords do not match. Please try again.");
      return;
    }
    console.log("Form submitted:", formData);
    alert('Sign Up successful!');
  };

  return (
    <div style={styles.container}>
      <form onSubmit={handleSubmit} style={styles.card}>
        <div style={styles.icon}>ðŸ“–</div>
        <h2 style={styles.title}>Create account</h2>
        <p style={styles.subtitle}>
          Join ResearchNest to track your research progress
        </p>

        {/* Input fields using formData and handleChange */}
        <input
          type="text"
          name="fullName"
          placeholder="Full Name"
          value={formData.fullName}
          onChange={handleChange}
          style={styles.input}
          required
        />
        <input
          type="email"
          name="email" // Changed from missing 'email' variable to formData.email
          placeholder="you@university.edu"
          value={formData.email}
          onChange={handleChange}
          style={styles.input}
          required // Added required
        />

        {/* Role Dropdown */}
        <div style={styles.selectWrapper}>
            <select
              name="role"
              value={formData.role}
              onChange={handleChange}
              style={styles.select }
              required
            >
              <option value="" disabled hidden >
                Select Role
              </option>
              {roles.map((role) => (
                <option key={role} value={role}>
                  {role}
                </option>
              ))}
            </select>
            <span style={styles.selectArrow}></span>
        </div>

        <input
          type="password"
          name="password"
          placeholder="Minimum 6 characters"
          value={formData.password}
          onChange={handleChange}
          style={styles.input}
          minLength={6}
          required
        />

        <input
          type="password"
          name="confirmPassword"
          placeholder="Repeat your password"
          value={formData.confirmPassword}
          onChange={handleChange}
          style={styles.input}
          required
        />

        <button type="submit" style={styles.button}>
          Create Account
        </button>

        <p style={styles.loginText}>
          Already have an account? 
          <a href="/login" style={styles.loginLink}>Sign in</a>
        </p>
      </form>
    </div>
  );
};

